// src/Pages/Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';

function Dashboard() {
  return (
    <div style={{ padding: '20px' }}>
      <h1>Dashboard</h1>
      <p>Xin chào Admin!</p>
      <Link to="/restaurants">
        <button style={{ padding: '10px', marginTop: '10px' }}>Quản lý Nhà hàng</button>
      </Link>
    </div>
  );
}

export default Dashboard;
